import React, { useState, useEffect } from "react";

const NotesListPage = () => {
  //initial state
  let [notes, setNotes] = useState([]);

  useEffect(() => {
    getNotes();
  }, []);

  //function to get notes from the backend
  let getNotes = async () => {
    let response = await fetch("http://127.0.0.1:8000/api/"); // waits until this is done before going to the next method

    let data = await response.json();

    setNotes(data);
  };

  return (
    <div>
      <div className="notes-list">
        {notes.map((note, index) => (
          <h3 key={index}> {note.method}</h3>
        ))}
      </div>
    </div>
  );
};

export default NotesListPage;
